=head1 ATTRIBUTES


=head2 DomainEntryPoint => L<Paws::CodeArtifact::DomainEntryPoint>

A DomainEntryPoint
(https://docs.aws.amazon.com/codeartifact/latest/APIReference/API_DomainEntryPoint.html)
object that contains information about from which repository or
external connection the package version was added to the domain.


=head2 OriginType => Str

Describes how the package version was originally added to the domain.
An C<INTERNAL> origin type means the package version was published
directly to a repository in the domain. An C<EXTERNAL> origin type
means the package version was ingested from an external connection.



